export default function DateComposable(){

    function formatDate(date) {
        alert(new Date(`${date}Z`).toLocaleString())
        // Then specify how you want your dates to be formatted
        return new Date(`${date}Z`).toLocaleString();
    }

    return {
        formatDate
    };
}
